import React from "react";
import {
  View,
  ScrollView,
  Text,
  Animated,
  TextInput,
  Pressable,
  TouchableOpacity,
  Image,
} from "react-native";
import { SvgXml } from "react-native-svg";
import { useSelector, useDispatch } from "react-redux";
import { Color } from "../../assets/colors";
import { getOnlineUser, getOfflineMembers } from "../../Class/member";
import ActivityLoader from "../../components/ActivityLoader";
import { AntDesign, FontAwesome } from "@expo/vector-icons";
import BackHeader from "../../components/BackHeader";
import SubHeader from "../../components/SubHeader";

export default function MemberList({ navigation, route }) {
  const [Data, setData] = React.useState();
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const textColor = colors.getTextColor();
  const primaryColor = colors.getPrimaryColor();
  const assentColor = colors.getAssentColor();
  const backgroundColor = colors.getBackgroundColor();
  const secondaryColor = colors.getSecondaryColor();
  const user = useSelector((state) => state.user);
  const vendor = useSelector((state) => state.vendor);
  const [Loading, setLoading] = React.useState(true);
  const scrollY = new Animated.Value(0);
  const diffClamp = Animated.diffClamp(scrollY, 0, 300);
  const translateY = diffClamp.interpolate({
    inputRange: [0, 300],
    outputRange: [0, -300],
  });
  const [Search, setSearch] = React.useState();
  const offline=route.params.offline;
  

  React.useEffect(() => {
    if (user && vendor) {
      if(offline){
        getOfflineMembers(user.token,vendor.service.id).then(res=>{
          setLoading(false);
          setData(res.members);
        }).catch(err=>{
          setLoading(false);
          console.warn(err.response.data.message)
        })
        return
      }
      getOnlineUser(user.token, vendor.service.id)
        .then((res) => {
          setLoading(false);
          setData(res.members);
        })
        .catch((err) => {
          setLoading(false);
          console.warn(err.response.data.msg);
        });
    }
  }, [user + vendor]);
  if (Loading) {
    return <ActivityLoader />;
  }

  if (!Data) {
    return (
      <View
        style={{
          alignItems: "center",
          flex: 1,
          paddingTop: 30,
        }}
      >
        <SvgXml xml={vectorImage} width="80%" />
        <Text
          style={{
            color: textColor,
            fontSize: 16,
            marginTop: 20,
          }}
        >
          no member found
        </Text>
      </View>
    );
  }
  return (
    <ScrollView
      style={{ flexGrow: 1 }}
      stickyHeaderIndices={[0]}
      scrollEventThrottle={16}
      stickyHeaderHiddenOnScroll={true}
      showsVerticalScrollIndicator={false}
      onScroll={(e) => {
        scrollY.setValue(e.nativeEvent.contentOffset.y);
        //scroll;
      }}
    >
      <Animated.View
        style={[
          {
            transform: [{ translateY: translateY }],
            top: 0,
            left: 0,
            right: 0,
            backgroundColor: secondaryColor,
            zIndex: 500,
          },
        ]}
      >
        <SubHeader navigation={navigation} title="Select Member" />
        <View
          style={{
            flexDirection: "row",
            marginHorizontal: 10,
            marginVertical: 0,
            justifyContent: "space-between",
            marginBottom: 15,
          }}
        >
          <View
            style={{
              flexDirection: "row",
              alignItems: "center",
              backgroundColor: "#f5f5f5",
              paddingHorizontal: 15,
              paddingVertical: 8,
              flex: 2,
              borderRadius: 20,
              justifyContent: "flex-start",
            }}
          >
            <AntDesign
              style={{ marginRight: 10 }}
              name="search1"
              size={24}
              color={assentColor}
            />
            <TextInput
              value={Search}
              onChangeText={(e) => {
                //setSearch(e);
              }}
              placeholderTextColor={assentColor}
              placeholder="Search Now"
              returnKeyType="search"
            />
          </View>
        </View>
      </Animated.View>
      <Text
        style={{
          marginHorizontal: 20,
          marginVertical: 10,
          fontSize: 16,
          color: textColor,
          fontFamily: "Poppins-SemiBold",
        }}
      >
        {Data.length > 9 ? Data.length : "0" + Data.length} Members
      </Text>
      {Data.map((doc, i) => (
        <UserCart onSelect={()=>{
          navigation.navigate("VendorServiceList",{userId:doc.userId?doc.userId:doc.id,offline:offline})
        }} data={doc} key={i} />
      ))}
    </ScrollView>
  );
}
const vectorImage = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="345" height="191" viewBox="0 0 345 191">
<defs>
  <pattern id="pattern" preserveAspectRatio="xMidYMid slice" width="100%" height="100%" viewBox="0 0 1024 732">
    <image width="1024" height="732" xlink:href="data:image/jpeg;base64,"/>
  </pattern>
</defs>
<rect id="_Downloader.la_-635e82e3ede14" data-name="[Downloader.la]-635e82e3ede14" width="345" height="191" fill="url(#pattern)"/>
</svg>
`;
const UserCart = ({ data, onSelect }) => {
  
  const isDark = useSelector((state) => state.isDark);
  const colors = new Color(isDark);
  const textColor = colors.getTextColor();
  const primaryColor = colors.getPrimaryColor();
  const assentColor = colors.getAssentColor();

  return (
    <TouchableOpacity
      onPress={() => {
        if (onSelect) {
          onSelect(data.id);
        }
      }}
    >
      <View
        style={{
          backgroundColor: primaryColor,
          paddingHorizontal: 10,
          paddingVertical: 0,
          paddingTop: 0,
        }}
      >
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            alignItems: "center",
            paddingTop: 5,
          }}
        >
          <View style={{ flexDirection: "row", alignItems: "center", flex: 1 }}>
            <View
              style={{
                borderWidth: 1,
                width: 50,
                height: 50,
                borderRadius: 25,
                justifyContent: "center",
                alignItems: "center",
                overflow: "hidden",
                borderColor: "#e5e5e5",
              }}
            >
              {data &&data.user&& data.user.profilePhoto ? (
                <Image
                  style={{
                    height: 50,
                    width: 50,
                  }}
                  source={{ uri: data.user.profilePhoto }}
                />
              ):data&&data.profilePhoto?(
                <Image
                  style={{
                    height: 50,
                    width: 50,
                  }}
                  source={{ uri: data.profilePhoto }}
                />
              ) : (
                <FontAwesome name="user" size={35} color={assentColor} />
              )}
            </View>
            <View
              style={{
                marginLeft: 10,
                flex: 1,
                marginRight: 20,
              }}
            >
              {data&&data.user?(
                <Text
                numberOfLines={1}
                style={{
                  color: textColor,
                  fontSize: 16,
                  fontFamily: "Poppins-Medium",
                }}
              >
                {data ? data.user.firstName : "Um"}{" "}
                {data ? data.user.lastName : "Um"}
              </Text>
              ):(<Text
                numberOfLines={1}
                style={{
                  color: textColor,
                  fontSize: 16,
                  fontFamily: "Poppins-Medium",
                }}
              >
                {data.name}
              </Text>)}
              <Text
                numberOfLines={1}
                style={{
                  fontSize: 14,
                  color: textColor,
                  fontFamily: "Poppins-Medium",
                }}
              >
                {"@"}
                {data&&data.user ? data.user.username:data&&data.name?data.name.split(" ")[0].toLowerCase() : "Empty position"}
              </Text>
            </View>
          </View>
        </View>
        <View
          style={{
            height: 1,
            backgroundColor: "#F1EFEF",
            marginLeft: 60,
            marginTop: 10,
          }}
        />
      </View>
    </TouchableOpacity>
  );
};
